import java.util.*;
import java.io.*;

class  Main {
    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder();
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int k = sc.nextInt();
        int[] a = new int[n];
        int[] b = new int[n];
        long sumA = 0;
        long sumB = 0;
        for (int i = 0; i < a.length; i++) {
            a[i] = sc.nextInt();
            sumA += a[i];
        }
        for (int i = 0; i < b.length; i++) {
            b[i] = sc.nextInt();
            sumB += b[i];
        }
        Arrays.sort(a);
        Arrays.sort(b);
        if (Math.abs(sumA - sumB) > k) {
            System.out.println("NO");
        } else {
            int i = 0;
            int j = i;
            int count = 0;
            boolean isDoable = true;
            while (i < a.length && j < b.length) {
                if (a[i] > b[j]) {
                    if (a[i] - b[j] <= k) {
                        count++;
                    }
                    if (count > 1) {
                        isDoable = false;
                        break;
                    }
                    j++;
                } else if (a[i] < b[j]) {
                    i++;
                } else {
                    i++;
                    j++;
                }
            }
            if (isDoable) {
                System.out.println("YES");
            } else {
                System.out.println("NO");
            }
        }
    }
}
